fn fill(&mut self, hole: Hole, goto: InstPtr) {
    match hole {
        Hole::None => {}
        Hole::One(pc) => {
            self.insts[pc].fill(goto);
        }
        Hole::Many(holes) => {
            for hole in holes {
                self.fill(hole, goto);
            }
        }
    }
}

